import React from 'react';
import './style.css';

const Footer = (props) => {
  return (
    <footer className="Footer">
      <section>
      Designed and built by{' '}
        <a target="https://www.linkedin.com/in/pranav-chachra-03b2921bb">Pranav Chachra</a>
      </section>
    </footer>
  );
};

export default Footer;
